-- Update BOR stylesheet for new visual identity guidelines
update dbo.FileResourceData set [Data] = 
where FileResourceInfoID = (select TenantStyleSheetFileResourceInfoID from dbo.TenantAttribute where TenantID = 12)

update dbo.FileResourceInfo set [CreateDate] = CURRENT_TIMESTAMP
where FileResourceInfoID = (select TenantBannerLogoFileResourceInfoID from dbo.TenantAttribute where TenantID = 12)

-- Update banner logo
update dbo.FileResourceData set [Data] = 
where FileResourceInfoID = (select TenantBannerLogoFileResourceInfoID from dbo.TenantAttribute where TenantID = 12)

update dbo.FileResourceInfo set [OriginalBaseFilename] = 'BofR-horiz-cmyk-white-type', [OriginalFileExtension] = '.png', [CreateDate] = CURRENT_TIMESTAMP
where FileResourceInfoID = (select TenantBannerLogoFileResourceInfoID from dbo.TenantAttribute where TenantID = 12)

-- Update BOR organization logo
update dbo.FileResourceData set [Data] = 
where FileResourceInfoID = (select LogoFileResourceInfoID from dbo.Organization where TenantID = 12 and OrganizationName = 'U.S. Bureau of Reclamation')

update dbo.FileResourceInfo set [OriginalBaseFilename] = 'BofR-vert-cmyk', [OriginalFileExtension] = '.png', [CreateDate] = CURRENT_TIMESTAMP
where FileResourceInfoID = (select LogoFileResourceInfoID from dbo.Organization where TenantID = 12 and OrganizationName = 'U.S. Bureau of Reclamation')
